@import '../variables';
@import '../mixins';

.appointment {
  @include position-centered;
  position: relative;
  max-width: $block-width;
  margin: 100px auto 94px;
  flex-direction: column;
  overflow: hidden;
  
  .appointment__slider {
    display: flex;
    transition: transform 0.5s ease-in-out;
    height: 440px;

    .appointment__container {
      width: 100%;
      height: 100%;
  
      .appointment__content {
        position: absolute;
        top: 53px;
        left: 62px;
        z-index: 15;
  
        .appointment__title {
          font-size: 38px;
          font-style: normal;
          font-weight: 700;
          line-height: normal;
          text-transform: uppercase;
          color: $color-5;
        }
  
        .appointment__small-title {
          font-size: 22px;
          font-style: normal;
          font-weight: 700;
          line-height: normal;
          color: $color-5;
        }
  
        .appointment__list {
          margin-top: 16px;
          color: $color-3;
          display: flex;
          flex-direction: column;
          justify-content: flex-start;
          gap: 9px;
  
          .appointment__list-element {
            list-style-type: none;
            text-indent:-5px;
            &::before {
              display: inline-block;
              color: $color-3;
              content: "•";
              margin-left: 3px;
              padding-right: 10px;
            }
          }
  
          .appointment__list-span {
            font-size: 16px;
            font-style: normal;
            font-weight: 400;
            line-height: normal;
            color: $color-5;
          }
        }
  
        .appointment__price {
          font-size: 20px;
          font-style: normal;
          font-weight: 400;
          line-height: normal;
          color: $color-5;
          display: flex;
          margin-top: 33px;
          gap: 16px;
  
          .appointment__price_crossed {
            color: $color-6;
            text-decoration: line-through;
          }
        }
  
        .appointment__button-container {
          margin-top: 27px;
          display: flex;
          gap: 14px;
  
          .appointment__button {
            @include button-common-styles;
          }
  
          .appointment__button_color_green {
            background-color: $color-1;
            color: $color-2;
            transition: .1s linear;
            cursor: pointer;
  
            &:hover {
              background-color: $color-10;
            }
          }
  
          .appointment__button_color_white {
            background-color: $color-7;
            color: $color-1;
            border: 2px solid $color-1;
            transition: .1s linear;
            cursor: pointer;
  
            &:hover {
              background-color: $color-1;
              color: $color-2;
            }
          }
        }
      }
  
      .appointment__foreground-image {
        position: absolute;
        top: 0;
        left: 0;
        z-index: 10;
      }
  
      .appointment__background-image {
        z-index: 5;
        position: absolute;
        top: 0;
        right: 0;
      }
    }
  }

  .appointment__slider-buttons {
    margin-top: 34px;
    display: flex;
    align-items: center;
    gap: 36px;

    .appointment__arrow-button {
      display: flex;
    align-items: center;
    justify-content: center;
      border: none;
      background-color: $color-2;
      width: $arrow-size;
      height: 30px;
      cursor: pointer;
      transition: .1s linear;
      font-size: 40px;
      color: #E1E1E1;
      &:hover {
        color: #0DBC91;
      }
    }

    .appointment__pages {
      font-size: 18px;
      font-weight: 400;
      font-style: normal;
      line-height: normal;

      .appointment__total-pages {
        color: $color-8;
      }
    }
  }
}

@media screen and (max-width: $mobileWidth) {
  .appointment {
    margin-top: 54px;
    margin-bottom: 35px;
    overflow: visible;

    .appointment__slider {
      height: 536px;

      .appointment__container {
        height: 536px;
        width: $block-width-mobile;

        .appointment__foreground-image {
          display: none;
        }

        .appointment__background-image {
          width: $block-width-mobile;
          height: 169px;
          position: relative;
        }

        .appointment__content {
          width: $block-width-mobile;
          background-color: $color-11;
          z-index: 20;
          position:static;
          padding-top: 22px;
          padding-bottom: 42px;

          .appointment__title {
            max-width: fit-content;
            font-size: 28px;
            margin-left: 23px;
          }

          .appointment__small-title {
            max-width: fit-content;
            font-size: 14px;
            margin-left: 23px;
          }

          .appointment__list {
            margin-left: 29px;
            max-width: 271px;
            .appointment__list-element {
              .appointment__list-span {
                font-size: 14px;
                line-height: 145%;
              }
            }
          }

          .appointment__price {
            margin-left: 23px;
            font-size: 18px;
            gap: 10px;
            margin-top: 17px;

            .appointment__price_crossed {
              font-size: 18px;
            }
          }

          .appointment__button-container {
            margin-left: 23px;
            gap: 6px;
            .appointment__button_color_green {
              @include button-common-styles-mobile;
            }

            .appointment__button_color_white {
              @include button-common-styles-mobile;
            }
          }
        }
      }
    }

    .appointment__slider-buttons {
      margin-top: 16px;
    }
  }
}

