@import '../variables';
@import '../mixins';

.navigation {
  background-color: $color-3;
  @include position-centered;
  margin-top: 12px;
  
  .navigation__contact-button {
    display: none;
    @include button-common-styles;
  }

  .navigation__list {
    max-width: 90%;
    width: $block-width;
    height: 43px;
    display: flex;
    align-items: center;
    gap: 30px;

    .navigation__link {
      @include text-common-styles;
      text-decoration: none;
      color: $color-2;
      transition: .4s linear;
      &:hover {
        opacity: $opacity;
      }
    }
  }
}

@media screen and (max-width: $mobileWidth) {
  .navigation {
    margin-top: 0;
    z-index: 25;
    visibility: hidden;
    position: fixed;
    width: 100vw;
    height: 100vh;
    background: rgba(69, 146, 127, 0.90);
    backdrop-filter: blur(2px);
    opacity: 0;
    transition: opacity 0.1s linear;

    .navigation__list {
      flex-direction: column;
      align-items: flex-start;
      gap: 10px;
      position: absolute;
      left: 21px;
      top: 113px;
    }

  .navigation__contact-button {
    position: absolute;
    left: 21px;
    top: 310px;
    display: block;
    background-color: $color-12;
    color: $color-3;
    font-size: 13px;
    font-style: normal;
    font-weight: 700;
    line-height: 21px;
    transition: .1s linear;
    &:hover {
      color: $color-2;
      background-color: $color-1;
    }
  }
  }

  .navigation_visible {
    visibility: visible;
    display: flex;
    flex-direction: column;
    align-items: flex-start;
    opacity: 1;
  }
}

